import actionCreatorFactory, { Action } from "typescript-fsa";
import { UserBalance } from "../../api-client-codegen";
const actionCreator = actionCreatorFactory();

export type UserStateType = {
    readonly loading: boolean;
    readonly balance: UserBalance;
  };


export type GetUserDonePayload = {
    loading: boolean;
    balance: UserBalance;
  };

export const triggerGetUser = actionCreator(
    "project/TRIGGER_GET_USER"
  );

  export const getUser = actionCreator.async<
    Action<UserBalance>,
    GetUserDonePayload
  >("project/GET_USER");
